    number: '6'
    value: 'See Misc Report to FEC for amended items as well. Payments reported on
      Sch B Ln 30b for FEA: direct mail-gotv, and FEA: walk map printing-gotv all
      represent generic campaign activity and do not promote, attack, support or oppose
      any specifically identified Federal candidate and do not constitute an in-kind
      contribution, an independent expenditure or a coordinated party expenditure.
      All payments on Sch H4 Line 21a for audio/video, audio/visual and media consulting
      were for generic use of the Committee. The negative disbursement from the John
      McCain 2008 represents a reimbursement of expenses for use of copy machine,
      cleaning and cable expense utilized by representatives of the John McCain campaign.
      The payment on Sch H4 Ln 21a for lighting was for generic use of the Committee.
      The expenditures reported on Sch H4 to individuals for rent represent rent income
      to these individuals for space rented from them. The error messages referring
      to Subordinate Committee name information missing from Schedule F should not
      be errors. There is no Subordinate Committee to report for the coordinated expenditures
      on Schedule F. On Schedule D there is a credit of $4,910 reflected in the Amount
      Incurred This Period box for The Tarrance Group - this bill was paid in August
      and is reflected on Schedule F. On Schedule D there is a credit of $2,075 reflected
      in the Amount Incurred This Period box for Majority Strategies - this particular
      bill for $2,075 was inadvertently recorded as a Federal Debt as of 7/31/08 when
      it was actually a debt for the Nonfederal account. All disbursements for salaries
      and benefits disclosed on Schedule H4 are for employees who did not spend more
      than 25% of their compensated time during the reporting period on Federal election
      activities or activities in connection with a Federal election. The Committee
      uses the Escrow option for receipt of corporate in-kind donations as provided
      for by the Commission in Advisory Opinion 1992-33. The method ensures that prohibited
      sources are not used to fund the federal share of allocable activity expenses.
      In-kind details and the escrow account activity are summarized as follows: Administrative
      Escrow account and In-kinds: 8/1/08 balance in Administrative escrow account
      of $14,187.49.  8/9/08 Yuma Solutions in-kind of $5,000 as reflected on Sch
      H4 and transfer on Sch H3 using $1,400 of escrow balance. 8/10/08 Disney Worldwide
      Services in-kind of $2,964.96 as reflected on Sch H4 and transfer on Sch H3
      using $830.19 of escrow balance. 8/31/08 balance in Administrative escrow account
